import React, { useState } from 'react';
import './CSS/CSS_FILE.css';
const Header = () => {
    return (
                <div class="header">
                    <div class="logo-name">
                        <a href="#">&nbsp;Sahil Aggarwal</a>
                    </div>
                    <div class="linkers">
                        <Link to="/About"><a href="#">&nbsp;Home</a></Link>
                        <Link to="/Experience"><a href="#experience">&nbsp;&nbsp;Experience</a></Link>
                        <Link to="/Skills"><a href="#skills">&nbsp;&nbsp;Skills</a></Link>
                        <Link to="/Contact"><a href="#contact">&nbsp;&nbsp;Contact&nbsp;&nbsp;</a></Link>
                    </div>
                </div>  
    );
}
export default Header;
